import React from "react";
import { Navbar, Button, Link } from "@nextui-org/react";
import { Layout } from "./Navbar/Layout.js";
import { AcmeLogo } from "./Navbar/AcmeLogo.js";
import { useTheme, Text } from '@nextui-org/react';
import Theme from './theme.js';

export default function App() {

  const [variant] = React.useState("sticky");

  colors: {
    // generic colors
    white: '#ffffff';
    black: '#000000';

    // background colors (light)
    background: "$white";
    backgroundAlpha: "rgba(255, 255, 255, 0.8)"; // used for semi-transparent backgrounds like the navbar
    foreground: "$black";
    backgroundContrast: "$white";


    //semantic colors (light)
    blue50: '#EDF5FF';
    // ...
    blue900: '#00254D';
    // ...

    // brand colors
    primaryLight: '$blue200';
    primaryLightHover: '$blue300'; // commonly used on hover state
    primaryLightActive: '$blue400'; // commonly used on pressed state
    primaryLightContrast: '$blue600'; // commonly used for text inside the component
    primary: '$blue600';
    primaryBorder: '$blue500';
    primaryBorderHover: '$blue600';
    primarySolidHover: '$blue700';
    primarySolidContrast: '$white'; // commonly used for text inside the component
    primaryShadow: '$blue500';

    // ... rest of colors (secondary, success, warning, error, etc)
  }

  return (
    <Layout>
      <Navbar color="black" bg="black" isBordered variant={variant}>
        <Navbar.Brand>
          <AcmeLogo />
          <Text b color="inherit" hideIn="xs">
            OSIRIS
          </Text>
        </Navbar.Brand>
        <Navbar.Content hideIn="xs">
          <Navbar.Link href="#">Home</Navbar.Link>
          <Navbar.Link isActive href="#">Features</Navbar.Link>
          <Navbar.Link href="#">Purchase</Navbar.Link>
        </Navbar.Content>
        <Navbar.Content>
          <Navbar.Item>
            <Button auto flat as={Link} href="#">
              Purchase
            </Button>
          </Navbar.Item>
        </Navbar.Content>
      </Navbar>

      <>
      <Text size="$3xl"  style={{marginLeft: "300px", marginTop: "250px", fontWeight: "bold" }} className="text">The Greatest Streamable</Text>
    </>
    </Layout>
  );
}
